# Instantiate and deploy contract
DPM = w3.eth.contract(abi=DPM_abi,bytecode=DPM_bin)

# Submit the transaction that deploys the contract
tx_hash = DPM.constructor().transact()

# Wait for the transaction to be mined, and get the transaction receipt
tx_receipt = w3.eth.waitForTransactionReceipt(tx_hash)

# Create the contract instance with the newly-deployed address
dpm = w3.eth.contract(
    address=tx_receipt.contractAddress,
    abi=DPM_abi)

# writing deployment information in file 
f = open( 'DocumentPermissionManagement.txt', 'w' )
f.write( 'transaction_information = ' + repr(tx_receipt) + '\n' )
f.close()
print ("Document Permission Management deployed")


